import React from "react";
import Header from "../Header/Header";
import "./partnerPage.css";

const PartnerPage = props => {
    return (
        <div>
            <Header 
            partnerLink={"#"}
            productLink={"/#productHome"}
            />
        </div>
    )
}

export default PartnerPage;
